import React from 'react'
import './Error.css'
import Legend from './Legend.js'

export default function Error(selectedAlg) {

    return (
        <div>
            <div className='Error' id='Error'>
                Error: 0
            </div>
            <Legend selectedAlg={selectedAlg}></Legend>
        </div>
    )
}
